import './App.css';

function App() {
  const colorInput = (e) => {
    console.log(e.target.value)
  }

  return (
    <div className="App">
      <h1>RGB, CMYK, HLS</h1>
      <div>
        <input type='color' onInput={colorInput}/>
      </div>
      <div>
        <span>RGB</span>
        <input type='text'/>
      </div>
      <div>
        <span>CMYK</span>
        <input type='text'/>
      </div>
      <div>
        <span>HLS</span>
        <input type='text'/>
      </div>
    </div>
  );
}

export default App;
